import { useNavigation } from '@react-navigation/native'
import React from 'react'
import { StyleSheet, Text, View, Image, TouchableOpacity } from 'react-native'
import { SafeAreaView } from 'react-native-safe-area-context'

const Intro = () => {
  const navigation = useNavigation()

  return (
    <SafeAreaView style={{ flex: 1, backgroundColor: 'white' }}>
      <View style={{ flex: 0.5 }}>
        <Image
          resizeMode="contain"
          style={{
            height: 70,
            alignSelf: 'center',
            marginTop: 'auto',
          }}
          source={require('../assets/logo_black.png')}
        />
      </View>

      <View style={{ flex: 0.5, marginHorizontal: 40 }}>
        <Text style={{ marginTop: 160, fontSize: 18 }}>
          calculate humidity in your room based on the temperature inside and
          your location
        </Text>

        <TouchableOpacity
          style={{
            backgroundColor: '#220F80',
            color: 'white',
            marginTop: 40,
            height: 50,
            justifyContent: 'center',
            borderRadius: 4,
          }}
          onPress={() => navigation.navigate('Main')}
        >
          <Text
            style={{
              color: 'white',
              fontSize: 20,
              fontWeight: '500',
              alignSelf: 'center',
            }}
          >
            get started
          </Text>
        </TouchableOpacity>
      </View>
    </SafeAreaView>
  )
}

export default Intro
